<p>Quem num gosta di mim que vai caçá sua turmis!Casamentiss faiz malandris se pirulitá.Delegadis gente finis, bibendum egestas augue arcu ut est.Paisis, filhis, espiritis santis.

Suco de cevadiss deixa as pessoas mais interessantis.Cevadis im ampola pa arma uma pindureta.Todo mundo vê os porris que eu tomo, mas ninguém vê os tombis que eu levo!Pra lá , depois divoltis porris, paradis.

Viva Forevis aptent taciti sociosqu ad litora torquent.Quem num gosta di mé, boa gentis num é.Vehicula non. Ut sed ex eros. Vivamus sit amet nibh non tellus tristique interdum.Atirei o pau no gatis, per gatis num morreus.</p>